    borderRadius: "50px",
    overflow: "hidden",
    backgroundColor: "#fff",
  }}
>
  <input
    type="email"
    name="user_email"
    className="form-control border-0 px-4"
    placeholder="Your Email"
    style={{
      flex: 1,
      fontFamily: "IBM Plex Sans",
      fontWeight: 500,
